--  DDL for Table FS_ANIMAL_FARMING
--------------------------------------------------------

  CREATE TABLE "FS_ANIMAL_FARMING" 
   (	"ID" NUMBER(*,0), 
	"FEDERAL_STATE" VARCHAR2(100 CHAR), 
	"FEDERAL_STATE_CODE" CHAR(2 CHAR), 
	"ICON" VARCHAR2(11 CHAR), 
	"SPECIES" VARCHAR2(250 CHAR), 
	"STAT_YEAR" NUMBER, 
	"SUMMARY" NUMBER
   ) ;
--------------------------------------------------------
--  DDL for View ANIMAL_FSTATE_YEAR
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ANIMAL_FSTATE_YEAR" ("FEDERAL_STATE", "FEDERAL_STATE_CODE", "ICON", "SPECIES", "STAT_YEAR", "SUMMARY") AS 
  SELECT FEDERAL_STATE,
       FEDERAL_STATE_CODE,
       ICON,    
       SPECIES,
       STAT_YEAR,
       SUMMARY       
from FS_ANIMAL_FARMING;
--------------------------------------------------------
--  DDL for View ANIMAL_FSTATE_YEAR_AGGREGATED
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ANIMAL_FSTATE_YEAR_AGGREGATED" ("FEDERAL_STATE", "FEDERAL_STATE_CODE", "ICON", "STAT_YEAR", "SUMMARY") AS 
  SELECT FEDERAL_STATE,
       FEDERAL_STATE_CODE,
       ICON,    
       STAT_YEAR,
       SUM(SUMMARY) AS SUMMARY       
FROM ANIMAL_FSTATE_YEAR
GROUP BY ICON,FEDERAL_STATE_CODE,FEDERAL_STATE,STAT_YEAR;
--------------------------------------------------------
--  DDL for View ANIMAL_LINE_CHART
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ANIMAL_LINE_CHART" ("STAT_YEAR", "ICON", "TOTAL") AS 
  SELECT TRUNC(TO_DATE(STAT_YEAR,'YYYY'),'Y') AS STAT_YEAR, 
       ICON,
       SUM(SUMMARY) AS TOTAL
FROM ANIMAL_FSTATE_YEAR
WHERE STAT_YEAR != 2009
GROUP BY STAT_YEAR, ICON;
--------------------------------------------------------
--  DDL for View ANIMAL_PIE_CHART
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ANIMAL_PIE_CHART" ("SPECIES", "TOTAL", "ICON", "STAT_YEAR") AS 
  SELECT SPECIES,
       SUM(SUMMARY) AS TOTAL,
       ICON,
       STAT_YEAR
FROM ANIMAL_FSTATE_YEAR
GROUP BY SPECIES,ICON,STAT_YEAR;
--------------------------------------------------------
--  DDL for View ANIMAL_PRO_YEAR_ICON
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ANIMAL_PRO_YEAR_ICON" ("ICON", "STAT_YEAR", "TOTAL", "PRCT") AS 
  SELECT ICON,
       STAT_YEAR,
       TOTAL,
       TOTAL/(MAX(TOTAL) OVER (PARTITION BY ICON)) PRCT
FROM (SELECT ICON,
             STAT_YEAR,    
             SUM(SUMMARY) AS TOTAL
      FROM ANIMAL_FSTATE_YEAR_AGGREGATED
      GROUP BY ICON,STAT_YEAR
     );
