--  DDL for View TIMELINE
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "TIMELINE" ("START_DATE", "END_DATE", "HEADLINE", "DESCRIPTION", "MEDIA_URL") AS 
  SELECT to_date('01.01.'||(level + 2006),'DD.MM.YYYY') as start_date,
       to_date('01.01.'||(level + 2006),'DD.MM.YYYY') as end_date,
       level + 2006 as headline ,
       level + 2006 as description,
       null as media_url
  FROM dual connect by  level < 11;
--------------------------------------------------------
--  DDL for Materialized View FS_ANIMAL_FARMING_MV
--------------------------------------------------------

  CREATE MATERIALIZED VIEW "FS_ANIMAL_FARMING_MV" ("ICON", "STAT_YEAR", "TOTAL", "COUNT(SUMMARY)", "COUNT(*)")
  ORGANIZATION HEAP PCTFREE 10 PCTUSED 40 INITRANS 1 MAXTRANS 255 
  NOCOMPRESS LOGGING
  REFRESH FAST ON DEMAND
  USING DEFAULT LOCAL ROLLBACK SEGMENT
  USING ENFORCED CONSTRAINTS ENABLE QUERY REWRITE
  AS SELECT ICON,    
               STAT_YEAR,
               SUM(SUMMARY) AS TOTAL,
               COUNT(SUMMARY),
               COUNT(*)
FROM FS_ANIMAL_FARMING
GROUP BY ICON,
                    STAT_YEAR;

  CREATE UNIQUE INDEX "I_SNAP$_FS_ANIMAL_FARMING_" ON "FS_ANIMAL_FARMING_MV" (SYS_OP_MAP_NONNULL("ICON"), SYS_OP_MAP_NONNULL("STAT_YEAR")) 
  ;

   COMMENT ON MATERIALIZED VIEW "FS_ANIMAL_FARMING_MV"  IS 'snapshot table for snapshot DB.FS_ANIMAL_FARMING_MV';
REM INSERTING into FS_ANIMAL_FARMING
SET DEFINE OFF;
--------------------------------------------------------
