--------------------------------------------------------

  CREATE UNIQUE INDEX "I_SNAP$_FS_ANIMAL_FARMING_" ON "FS_ANIMAL_FARMING_MV" (SYS_OP_MAP_NONNULL("ICON"), SYS_OP_MAP_NONNULL("STAT_YEAR")) 
