--  DDL for Function IS_ANIMAL_DISPLAYED_ON_DB
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE FUNCTION "IS_ANIMAL_DISPLAYED_ON_DB" 
    (P_YEAR  IN FS_ANIMAL_FARMING.STAT_YEAR%TYPE,
     P_ICON   IN FS_ANIMAL_FARMING.ICON%TYPE,
     P_ID         IN FS_ANIMAL_FARMING.ID%TYPE
    ) 
RETURN FS_ANIMAL_FARMING.ID%TYPE
DETERMINISTIC
is
begin
  if P_YEAR = '2007' and P_ICON = 'cow' then
    return p_id;
  else
    return null;
  end if;  
end;

